shareholder_purpose:
{"shareholder_purpose": "- Handel mit Computer Hardware, Netzwerkkomponenten und Software;
- Unternehmensberatung;
- Software Entwicklung und Services;
- Webservices;
- Entwicklung von Geschäftsideen zu anwendbaren Unternehmenslösungen, Konzeption und Aufbau einer passenden technischen und organisatorischen Unternehmennsstruktur (Company Builder);
- Unternehmensbeteiligungen und Gründung von neuen Unternehmen mit Venture Capital (Wagnis Kapital) aus innovativen Konzepten und Ideen."}

{"shareholder_purpose": "Zweck der Gesellschaft ist das Halten und Verwalten von eigenen Beteiligungen;
Verwaltung eigenen Vermögens;
kaufen, halten, verwalten und veräußern von Immobilien,
die Förderung, Beratung und Finanzierung von Unternehmungen u.a. im IT- und Personalberatungsbereich und damit zusammenhängende Dienstleistungen.
Sie kann ebenfalls Lizenzen halten, verwerten und veräußern sowie
immaterielle und materielle Projekte und Produkte entwickeln.
Zudem kann sie den Handel mit entwickelten Produkten und Dienstleistungen insbesondere im IT-Bereich betreiben."}

{"shareholder_purpose": "- Krankenhäuser, Rehabilitationskliniken und andere Einrichtungen des Gesundheits- und Sozialwesens zu planen und zu errichten (Planungs- und Errichtungsfunktion);

- für Krankenhäuser Rehabilitationskliniken und andere Einrichtungen des Gesundheits- und Sozialwesens Trägeraufgaben zu übernehmen (Trägerfunktion);

- Krankenhäuser, Rehabilitationskliniken und andere Einrichtungen des Gesundheits- und Sozialwesens zu betreiben (Betreiberfunktion) oder Dienstleistungen für Gesundheits-, Sozial- und Schulungseinrichtungen zu erbringen;

- Krankenhäuser, Rehabilitationskliniken und andere Einrichtungen des Gesundheits- und Sozialwesens das Management oder spezifische andere Dienstleistungen zu übernehmen (Managementfunktion)"}

{"shareholder_purpose": "Die Leitung einer Gruppe von Unternehmen, die insbesondere auf folgenden Geschäftsfeldern tätig sind:
1. Betreiben und Vermarkten der Eisenbahninfrastruktur, insbesondere Planung, Bau, Unterhaltung sowie Führung von Betriebsleit- und Sicherheitssystemen;
2. Verkehrsleistungen zur Beförderung von Gütern und Personen, insbesondere auf dem Gebiet des Schienenverkehrs;
3. Logistikleistungen aller Art, insbesondere Transport-, Speditions-, Fracht- und Lagerleistungen;
4. Beratungs- und Dienstleistungen aller Art, insbesondere in den Bereichen Verkehr, Logistik, lT und Telekommunikation.
Die Gesellschaft kann in den in Absatz 1 genannten Geschäftsfeldern auch selbst tätig werden.
Die Gesellschaft ist zu allen Geschäften und sonstigen Maßnahmen berechtigt, die zur Förderung des Unternehmensgegenstandes geeignet erscheinen. Hierzu gehören auch der Erwerb, das Halten und die Veräußerung von Beteiligungen an Unternehmen sowie die Errichtung von Zweigniederlassungen im In- und Ausland."}
